import hbs from 'handlebars-extd';
import moment from 'moment';
import bootstrap from '~/utils/bootstrap';

/**
 * Send push notifications to visitors using toast.
 * @example
 * ```js
 * import {Toast} from 'metronic-extension';
 * 
 * // Show success toast message.
 * Toast.success('This is a toast message');
 * 
 * // Show info toast message.
 * Toast.info('This is a toast message');
 * 
 * // Show error toast message.
 * Toast.error('This is a toast message');
 * 
 * // Show warning toast message.
 * Toast.warning('This is a toast message');
 * ```
 */
export default class {
  /** 
   * Audio object.
   * @type {HTMLAudioElement|undefined}
   */
  static #notifSound: HTMLAudioElement|undefined;

  /**
   * Show success toast message.
   * @param {string} message Toast Message.
   * @param {string|undefined} title? Toast Title. Default is no title (undefined).
   * @param {number} delay? Delay in milliseconds before hiding the toast. Default is 5000.
   */
  public static success(message: string, title: string|undefined = undefined, delay: number = 5000) {
    this.#show(message, title, 'success', delay);
  }

  /**
   * Show info toast message.
   * @param {string} message Toast Message.
   * @param {string|undefined} title? Toast Title. Default is no title (undefined).
   * @param {number} delay? Delay in milliseconds before hiding the toast. Default is 5000.
   */
  public static info(message: string, title: string|undefined = undefined, delay: number = 5000) {
    this.#show(message, title, 'info', delay);
  }

  /**
   * Show warning toast message.
   * @param {string} message Toast Message.
   * @param {string|undefined} title? Toast Title. Default is no title (undefined).
   * @param {number} delay? Delay in milliseconds before hiding the toast. Default is 5000.
   */
  public static warning(message: string, title: string|undefined = undefined, delay: number = 5000) {
    this.#show(message, title, 'warning', delay);
  }

  /**
   * Show error toast message.
   * @param {string} message Toast Message.
   * @param {string|undefined} title? Toast Title. Default is no title (undefined).
   * @param {number} delay? Delay in milliseconds before hiding the toast. Default is 5000.
   */
  public static error(message: string, title: string|undefined = undefined, delay: number = 5000) {
    this.#show(message, title, 'error', delay);
  }

  /**
   * Show toast.
   * @param {string} message Toast Message.
   * @param {string|undefined} title? Toast Title. Default is no title (undefined).
   * @param {'success'|'info'|'warning'|'error'} type Toast Type.
   * @param {number} delay? Delay in milliseconds before hiding the toast. Default is 5000.
   */
  static async #show(message: string, title: string|undefined = undefined, type: 'success'|'info'|'warning'|'error', delay: number = 5000) {
    // Add a wrapper element that surrounds the toasts.
    let container = $('.toast-container');
    if (!container.length)
      // Create container element.
      container = $('<div />', {
        class: 'toast-container position-fixed bottom-0 start-0 p-3',
        style: 'z-index: 1080;'
      }).appendTo('body');

    // Create new toast element.
    const toastElement = $(hbs.compile(
      `<div
        class="toast bg-light-info fade show d-flex align-items-baseline"
        role="alert"
        aria-live="assertive"
        aria-atomic="true"
        style="box-shadow: 0px 0px 30px rgb(0 0 0 / 30%);padding: var(--bs-toast-padding-y) var(--bs-toast-padding-x);">
        {{#if (eq type 'success')}}
          <!--begin::Svg Icon | path: /var/www/preview.keenthemes.com/kt-products/docs/metronic/html/releases/2022-10-09-043348/core/html/src/media/icons/duotune/general/gen043.svg-->
          <span class="svg-icon svg-icon-success svg-icon-2 me-3"><svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect opacity="0.3" x="2" y="2" width="20" height="20" rx="10" fill="currentColor"/>
            <path d="M10.4343 12.4343L8.75 10.75C8.33579 10.3358 7.66421 10.3358 7.25 10.75C6.83579 11.1642 6.83579 11.8358 7.25 12.25L10.2929 15.2929C10.6834 15.6834 11.3166 15.6834 11.7071 15.2929L17.25 9.75C17.6642 9.33579 17.6642 8.66421 17.25 8.25C16.8358 7.83579 16.1642 7.83579 15.75 8.25L11.5657 12.4343C11.2533 12.7467 10.7467 12.7467 10.4343 12.4343Z" fill="currentColor"/>
          </svg></span>
          <!--end::Svg Icon-->
          {{!-- <i class="fas fa-check fs-2 text-success me-3"></i> --}}
        {{else if (eq type 'info')}}
          <!--begin::Svg Icon | path: /var/www/preview.keenthemes.com/kt-products/docs/metronic/html/releases/2022-10-09-043348/core/html/src/media/icons/duotune/general/gen044.svg-->
          <span class="svg-icon svg-icon-info svg-icon-2 me-3"><svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect opacity="0.3" x="2" y="2" width="20" height="20" rx="10" fill="currentColor"/>
            <rect x="11" y="14" width="7" height="2" rx="1" transform="rotate(-90 11 14)" fill="currentColor"/>
            <rect x="11" y="17" width="2" height="2" rx="1" transform="rotate(-90 11 17)" fill="currentColor"/>
          </svg></span>
          <!--end::Svg Icon-->
          {{!-- <i class="fas fa-info fs-2 text-info me-3"></i> --}}
        {{else if (eq type 'warning')}}
          <!--begin::Svg Icon | path: /var/www/preview.keenthemes.com/kt-products/docs/metronic/html/releases/2022-10-09-043348/core/html/src/media/icons/duotune/general/gen044.svg-->
          <span class="svg-icon svg-icon-warning svg-icon-2 me-3"><svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect opacity="0.3" x="2" y="2" width="20" height="20" rx="10" fill="currentColor"/>
            <rect x="11" y="14" width="7" height="2" rx="1" transform="rotate(-90 11 14)" fill="currentColor"/>
            <rect x="11" y="17" width="2" height="2" rx="1" transform="rotate(-90 11 17)" fill="currentColor"/>
          </svg></span>
          <!--end::Svg Icon-->
          {{!-- <i class="fas fa-exclamation-triangle fs-2 text-warning me-3"></i> --}}
        {{else}}
          <!--begin::Svg Icon | path: /var/www/preview.keenthemes.com/kt-products/docs/metronic/html/releases/2022-10-09-043348/core/html/src/media/icons/duotune/general/gen040.svg-->
          <span class="svg-icon svg-icon-danger svg-icon-2 me-3"><svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect opacity="0.3" x="2" y="2" width="20" height="20" rx="10" fill="currentColor"/>
            <rect x="7" y="15.3137" width="12" height="2" rx="1" transform="rotate(-45 7 15.3137)" fill="currentColor"/>
            <rect x="8.41422" y="7" width="12" height="2" rx="1" transform="rotate(45 8.41422 7)" fill="currentColor"/>
          </svg></span>
          <!--end::Svg Icon-->
          {{!-- <i class="fas fa-times fs-2 text-danger me-3"></i> --}}
        {{/if}}
        <div class="flex-root">
          <div
            class="toast-header align-items-baseline bg-transparent text-dark p-0{{#unless title}} border-bottom-0{{/unless}}">
            <strong class="me-auto" style="word-break: break-all;">
              {{#if title}}
                {{title}}
              {{else}}
                {{message}}
              {{/if}}
            </strong>
            <span class="text-dark fs-8">{{time}}</span>
            <div class="btn btn-sm btn-icon btn-active-color-primary" data-bs-dismiss="toast" aria-label="Close" style="transform: translate(25%, -25%);">
              <!--begin::Svg Icon | path: icons/duotune/arrows/arr061.svg-->
              <span class="svg-icon svg-icon-1"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none">
                <rect opacity="0.5" x="6" y="17.3137" width="16" height="2" rx="1" transform="rotate(-45 6 17.3137)" fill="currentColor"></rect>
                <rect x="7.41422" y="6" width="16" height="2" rx="1" transform="rotate(45 7.41422 6)" fill="currentColor"></rect>
              </svg></span>
              <!--end::Svg Icon-->
            </div>
          </div>
          {{#if title}} 
            <div class="toast-body px-0 pb-0 text-dark" style="word-break: break-all;">{{message}}</div>
          {{/if}}
        </div>
      </div>`)({title, message, type, time: moment().format('HH:mm:ss')})).appendTo(container);

    // Create new toast instance.
    const toast = new bootstrap.Toast(toastElement.get(0) as HTMLElement, {autohide: delay > 0, delay});

    // Play notification sound.
    await this.#playNotificationSound();

    // Toggle toast to show.
    toast.show();

    // Delete the element when you close the toast.
    toastElement.on('hidden.bs.toast', (evnt: any) => {
      $(evnt.currentTarget).remove();

      // Delete the container if there is no toast element.
      if (!container.find('.toast').length)
        container.remove();
    });
  }

  /**
   * Play notification sound.
   */
  static async #playNotificationSound() {
    if (!this.#notifSound) {
      const b64 = '';
      this.#notifSound = new Audio(`data:audio/mp3;base64,${b64}`);
    }

    // If audio is played while the document has never been clicked, an error will occur, so handling the error will ensure that the process is not interrupted.
    try {
      this.#notifSound.pause();
      this.#notifSound.currentTime = 0;
      await this.#notifSound.play();
    } catch {}
  }
}